import React from 'react';

// A simple SVG icon for the feedback list
const CheckIcon = () => (
    <svg xmlns="http://www.w3.org/2000/svg" width="20" height="20" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className="flex-shrink-0 mt-1 text-green-400">
        <path d="M22 11.08V12a10 10 0 1 1-5.93-9.14"></path>
        <polyline points="22 4 12 14.01 9 11.01"></polyline>
    </svg>
);

function BlueprintResults({ data, onBack }) {
    const { suggestions = [], improvedResume = {}, recommendedOpportunities = [] } = data || {};
    const { header = '', summary = '', experience = [], skills = '' } = improvedResume;

    return (
        <div className="p-4 md:p-8 text-white animate-fadeIn">
            <div className="max-w-7xl mx-auto">
                <div className="flex justify-between items-center mb-8">
                    <h2 className="font-orbitron text-3xl md:text-5xl font-bold neon-text text-cyan-300">Your AI Blueprint</h2>
                    <button onClick={onBack} className="px-4 py-2 rounded-md transition-all duration-300 font-semibold bg-white/10 hover:bg-white/20 text-white">&larr; Start Over</button>
                </div>

                <div className="grid grid-cols-1 lg:grid-cols-5 gap-8">
                    {/* Left Column: Improved Resume */}
                    <div className="lg:col-span-3">
                        <div className="h-full p-6 md:p-8 bg-black/50 border border-purple-400/30 backdrop-blur-sm rounded-xl">
                            <h3 className="font-orbitron text-2xl font-bold text-neon-purple mb-6">ATS-Optimized Resume</h3>
                            <div className="space-y-6 text-white/90">
                                <div className="text-center border-b border-purple-400/20 pb-4">
                                    {header.split('\n').map((line, index) => <p key={index} className="text-sm">{line}</p>)}
                                </div>
                                <div>
                                    <h4 className="font-bold text-lg text-neon-purple mb-2">Professional Summary</h4>
                                    <p className="text-sm leading-relaxed">{summary}</p>
                                </div>
                                <div>
                                    <h4 className="font-bold text-lg text-neon-purple mb-2">Experience</h4>
                                    <ul className="space-y-2">
                                        {experience.map((item, index) => <li key={index} className="text-sm leading-relaxed pl-4 relative before:content-['â€¢'] before:absolute before:left-0 before:text-neon-purple">{item}</li>)}
                                    </ul>
                                </div>
                                <div>
                                    <h4 className="font-bold text-lg text-neon-purple mb-2">Skills</h4>
                                    {skills.split('\n').map((line, index) => <p key={index} className="text-sm">{line}</p>)}
                                </div>
                            </div>
                        </div>
                    </div>

                    {/* Right Column: Feedback & Opportunities */}
                    <div className="lg:col-span-2 space-y-8">
                        {/* Actionable Feedback Section */}
                        <div className="p-6 bg-black/50 border border-cyan-400/30 backdrop-blur-sm rounded-xl">
                            <h3 className="font-orbitron text-2xl font-bold text-neon-blue mb-4">ATS Tips & Feedback</h3>
                            <ul className="space-y-4">
                                {suggestions.map((suggestion, index) => (
                                    <li key={index} className="flex items-start gap-3">
                                        <CheckIcon />
                                        <span className="text-sm text-white/80">{suggestion}</span>
                                    </li>
                                ))}
                            </ul>
                        </div>
                        {/* Recommended For You Section */}
                        <div className="p-6 bg-black/50 border border-pink-400/30 backdrop-blur-sm rounded-xl">
                            <h3 className="font-orbitron text-2xl font-bold text-neon-pink mb-4">Recommended For You</h3>
                            <div className="space-y-4">
                                {recommendedOpportunities.length > 0 ? (
                                    recommendedOpportunities.map(op => (
                                        <div key={op.id} className="bg-black/30 p-4 rounded-lg">
                                            <h4 className="font-bold text-white">{op.title}</h4>
                                            <p className="text-xs text-white/60 mb-2">{op.type}</p>
                                            <a href={op.url} target="_blank" rel="noopener noreferrer" className="text-sm font-semibold text-neon-pink hover:underline">
                                                Learn More &rarr;
                                            </a>
                                        </div>
                                    ))
                                ) : (
                                    <p className="text-sm text-white/70">No specific opportunities found. Try refining your resume.</p>
                                )}
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default BlueprintResults;
